namespace
{
    std::size_t callback(
            const char* in,
            std::size_t size,
            std::size_t num,
            std::string* out)
    {
        const std::size_t totalBytes(size * num);
        out->append(in, totalBytes);
        return totalBytes;
    }
}
using namespace HACK;

#define MAX_PARALLEL 500 /* number of simultaneous transfers */
#define NUM_URLS sizeof(urls)/sizeof(char *)

size_t dataLoader::write_cb(char *data, size_t size, size_t nmemb, void *userp)
{
  (void)data;
  (void)userp;
  
  time_t now = time(0);
  tm *gmtm = gmtime(&now);
  
  Json::Reader jsonReader;
  Json::Value jsonData;
  if (jsonReader.parse(data, jsonData))
    {

      if (jsonData.size()==10){
        for (int i=0 ; i<5 ; i++){

          const std::size_t buy_price_min(jsonData[i]["buy_price_min"].asUInt());
          const std::string buy_price_min_date(jsonData[i]["buy_price_min_date"].asString());
          const std::size_t sell_price_min(jsonData[i+5]["sell_price_min"].asUInt());
          const std::string sell_price_min_date(jsonData[i+5]["sell_price_min_date"].asString());

          dt_utils::datetime dtCaerleon;
          dt_utils::datetime_format10 fmtCaerleon(dtCaerleon);
          dt_utils::datetime dtBlackMarket;
          dt_utils::datetime_format10 fmtBlackMarket(dtBlackMarket);
          
          dtCaerleon.clear();
          strtk::string_to_type_converter(sell_price_min_date, fmtCaerleon);
          dtBlackMarket.clear();
          strtk::string_to_type_converter(buy_price_min_date, fmtBlackMarket);


          int benefit = (buy_price_min-(3*buy_price_min/100))-sell_price_min;
          if (benefit>5000 && sell_price_min!=0){
            if (dtCaerleon.day==gmtm->tm_mday && dtCaerleon.month==1 + gmtm->tm_mon && dtBlackMarket.day==gmtm->tm_mday && dtBlackMarket.month==1 + gmtm->tm_mon
                && gmtm->tm_hour==dtCaerleon.hour && gmtm->tm_hour==dtBlackMarket.hour){
                  
              std::cout<<jsonData[i+5]["city"]<<"     Sell price min: "<<jsonData[i+5]["sell_price_min"]
                                                              <<" "<<dtCaerleon.hour<<"h"<<dtCaerleon.minute
                                                              <<"   "<<jsonData[i+5]["item_id"]<<" quality: "<<jsonData[i+5]["quality"]<<std::endl;
              std::cout<<jsonData[i]["city"]<<"  Buy price min: "<<jsonData[i]["buy_price_min"]
                                                              <<" "<<dtBlackMarket.hour<<"h"<<dtBlackMarket.minute<<std::endl;
              std::cout<<std::string(22,' ')+"Benefit: "<<benefit<<std::endl;
            }
          } 
          
        }
      }
      if (jsonData.size()!=10){ //TODO Check if less then five qualities
       //std::cout<<"Unexpected size"<<std::endl;
       //std::cout << jsonData.toStyledString() << std::endl;
      }
    }
    else
    {
      std::cout << "Could not parse HTTP data as JSON" << std::endl;
      std::cout << "HTTP data was:\n" << data << std::endl;
      return 1;
    }
  return size*nmemb;
}

void dataLoader::add_transfer(CURLM *cm, int i)
{
  CURL *eh = curl_easy_init();
  curl_easy_setopt(eh, CURLOPT_WRITEFUNCTION, write_cb);
  curl_easy_setopt(eh, CURLOPT_URL, urls[i]);
  curl_easy_setopt(eh, CURLOPT_PRIVATE, urls[i]);
  curl_multi_add_handle(cm, eh);
}

int dataLoader::multiLoad()
{
  CURLM *cm;
  std::string readBuffer;
  CURLMsg *msg;
  unsigned int transfers = 0;
  int msgs_left = -1;
  int still_alive = 1;

  curl_global_init(CURL_GLOBAL_ALL);
  cm = curl_multi_init();

  /* Limit the amount of simultaneous connections curl should allow: */
  curl_multi_setopt(cm, CURLMOPT_MAXCONNECTS, (long)MAX_PARALLEL);

  for(transfers = 0; transfers < MAX_PARALLEL; transfers++)
    add_transfer(cm, transfers);

  do {
    curl_multi_perform(cm, &still_alive);

    while((msg = curl_multi_info_read(cm, &msgs_left))) {
      if(msg->msg == CURLMSG_DONE) {
        char *url;
        CURL *e = msg->easy_handle;
        curl_easy_getinfo(msg->easy_handle, CURLINFO_PRIVATE, &url);
        //fprintf(stderr, "R: %d - %s <%s>\n",
              //msg->data.result, curl_easy_strerror(msg->data.result), url);
        curl_multi_remove_handle(cm, e);
        curl_easy_cleanup(e);
      }
      else {
        fprintf(stderr, "E: CURLMsg (%d)\n", msg->msg);
      }
      if(transfers < NUM_URLS)
        add_transfer(cm, transfers++);
    }
    if(still_alive)
      curl_multi_wait(cm, NULL, 0, 1000, NULL);

  } while(still_alive || (transfers < NUM_URLS));

  curl_multi_cleanup(cm);
  curl_global_cleanup();
  std::cout<<"End of Multi Load"<<std::endl;
  return EXIT_SUCCESS;
}

bool dataLoader::LoadData(std::string url, Json::Value &jsonData){
  
	Json::Reader jsonReader;

  //std::cout << url << std::endl;

  CURL* curl = curl_easy_init();

  // Set remote URL.
  curl_easy_setopt(curl, CURLOPT_URL, url.c_str());

  // Don't bother trying IPv6, which would increase DNS resolution time.
  curl_easy_setopt(curl, CURLOPT_IPRESOLVE, CURL_IPRESOLVE_V4);

  // Don't wait forever, time out after 10 seconds.
  curl_easy_setopt(curl, CURLOPT_TIMEOUT, 10);

  // Follow HTTP redirects if necessary.
  curl_easy_setopt(curl, CURLOPT_FOLLOWLOCATION, 1L);

  // Response information.
  long httpCode(0);
  std::unique_ptr<std::string> httpData(new std::string());

  // Hook up data handling function.
  curl_easy_setopt(curl, CURLOPT_WRITEFUNCTION, callback);

  // Hook up data container (will be passed as the last parameter to the
  // callback handling function).  Can be any pointer type, since it will
  // internally be passed as a void pointer.
  curl_easy_setopt(curl, CURLOPT_WRITEDATA, httpData.get());

  // Run our HTTP GET command, capture the HTTP response code, and clean up.
  curl_easy_perform(curl);
  curl_easy_getinfo(curl, CURLINFO_RESPONSE_CODE, &httpCode);
  curl_easy_cleanup(curl);
  
  if (httpCode == 200) //Caerleon,Black%20Market DATA
  {
    if (jsonReader.parse(*httpData.get(), jsonData))
    {
      //std::cout << jsonData.toStyledString() << std::endl;
      //const std::size_t buy_price_max(jsonData[0]["buy_price_max"].asUInt());
      //const std::string city(jsonData[0]["city"].asString());
      //std::cout <<"Buy Price Max: " << buy_price_max << std::endl;
      //std::cout <<"City: " << city << std::endl;
    }
    else
    {
      std::cout << "Could not parse HTTP data as JSON" << std::endl;
      std::cout << "HTTP data was:\n" << *httpData.get() << std::endl;
      return 1;
    }
  }
	
  return 0;
}